window.bookSummaryJSON = "<p>In this first exclusive e-book accompanying the Investigation Discovery series he created, “Dark Minds,” investigative journalist M. William Phelps, author of 20 books, a noted serial killer expert, explores what goes on behind-the-scenes in this unique serial killer series as he investigates and films an episode.</p> <p>Here, in Atlantic City, New Jersey, Phelps takes readers and fans of the series deep into his personal life and a dark connection to the <i>Eastbound Strangler</i> case, how he feels about several suspects named by law enforcement, and shares an exclusive interview he conducted with a woman who claims she was with the <i>Eastbound Strangler</i> and his final victim, Kim Raffo, on the night before Kim's body was found.</p> <p>What kind of serial killer removes his victims' shoes and socks...and lays them out in a row, facing east?</p>"; 
